import { Box, Link, Typography } from '@mui/material';
import { useState,useEffect } from 'react';
import Pagination from '@mui/material/Pagination';
import axios from 'axios';
const logo = require('../assets/images/animalspets.jpg');
const artgallery = require('../assets/images/Art-Galleries-in-Hyderabad.jpg');
const babieskids = require('../assets/images/babieskids.jpg');
const carbodypart = require('../assets/images/Car-Body-Parts.jpg');
const construction = require('../assets/images/construction.jpeg');
const electronics = require('../assets/images/');
const equipment = require('../assets/images/');
const gifts = require('../assets/images/');
const homegarden = require('../assets/images/');
const musical2 = require('../assets/images/');
const muslim = require('../assets/images/');
const phonetablet = require('../assets/images/');
const religeous = require('../assets/images/');
const sportexercise = require('../assets/images/');
const itemData = [    
    {
      img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
      title: 'Vehicle & Vehicle Accessories',
      author: '@rollelflex_graphy726',
    },
    {
      img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45',
      title: 'Phone& Tablets',
      author: '@helloimnik',
    },
    {
      img: 'https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c',
      title: 'Electronics',
      author: '@nolanissac',
      cols: 2,
    },
    {
      img: 'https://images.unsplash.com/photo-1533827432537-70133748f5c8',
      title: 'Home & Garden',
      author: '@hjrc33',
      cols: 2,
    },
    {
      img: 'https://images.unsplash.com/photo-1558642452-9d2a7deb7f62',
      title: 'Health & Beuty',
      author: '@arwinneil',
      rows: 2,
      cols: 2,
      featured: true,
    },
    {
      img: 'https://images.unsplash.com/photo-1516802273409-68526ee1bdd6',
      title: 'Fashion',
      author: '@tjdragotta',
    },
    {
      img: 'https://images.unsplash.com/photo-1518756131217-31eb79b20e8f',
      title: 'Sport & Exercise Equipment',
      author: '@katie_wasserman',
    },
    {
      img: 'https://images.unsplash.com/photo-1597645587822-e99fa5d45d25',
      title: 'Arts & Crafts',
      author: '@silverdalex',
      rows: 2,
      cols: 2,
    },
    {
      img: 'https://images.unsplash.com/photo-1567306301408-9b74779a11af',
      title: 'Musical Instrument',
      author: '@shelleypauls',
    },
    {
      img: 'https://images.unsplash.com/photo-1471357674240-e1a485acb3e1',
      title: 'Babies & Kidss',
      author: '@peterlaster',
    },
    {
      img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
      title: 'Animals & Pets',
      author: '@bkristastucchio',
      rows: 2,
      cols: 2,
      featured: true,
    },
    {
      img: 'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
      title: 'Equipment & Tools',
      author: '@southside_customs',
      cols: 2,
    },
    {
      img: 'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
      title: 'Gifts',
      author: '@southside_customs',
      cols: 2,
    },
    {
      img: 'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
      title: 'Religious Equipments',
      author: '@southside_customs',
      cols: 2,
    },
    {
      img: 'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
      title: 'Repair & Construction',
      author: '@southside_customs',
      cols: 2,
    },
  ];
const api=axios.create({
  baseURL:"http://localhost:5000/custom"
})
export default function Categories() {
  const y= (x)=>{
    if(x<650) return 2;
    else  return 4;
  }
  const z= (x)=>{
    if(x<650) return "175px";
    else  return "300px";
  }
  let [a,seta]=useState('https://images.unsplash.com/photo-1589118949245-7d38baf380d6') ; 
  const advertImages=[
    'https://plus.unsplash.com/premium_photo-1666497635505-fbe5ef5062f1?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1074&q=80',
    'https://images.unsplash.com/photo-1589118949245-7d38baf380d6',
    'https://images.unsplash.com/photo-1471357674240-e1a485acb3e1'
  ]
  let length=3;
  var width = window.innerWidth;
  let [index,setIndex]=useState(0);
    useEffect(()=>{
      const interval=setInterval(() => {
        if (index==3) {
          index=0;
          seta(advertImages[index])
        }
        else{
          seta(advertImages[index]);
        }
        setIndex(index+1);
      }, 15000);
      return ()=>clearInterval(interval);
    },[a])
    const api1=axios.create({
      baseURL:"http://localhost:5000/custom"
    });
    useEffect(()=>{
      api1.get('/categories')
      .then(res=>{
          console.log(res)
      })
      .catch(err=>{
        console.log(err);
      })
    },[])
    return (
      <div>
    <Box sx={{
        position :"absolute",
        height:"300px",
        width:"100%",
        backgroundImage:`url(${a})`,
        backgroundRepeat:"repeat-x"
    }}>
    </Box>
    <ImageList gap={6} sx={{ position:"absolute", 
    top:"350px" , zIndex:"2", width:"90%",
    //  background:"grey",
    left:"5%",
    }}>
        <ImageListItem key="Subheader" cols={y(width)}>
    </ImageListItem>
        {itemData.map((item) => (
          <Box key={item.img} sx={{
            borderColor:"red",
            borderWidth:"1px"
                      }}>
            <Typography  sx={{backgroundColor:"white",
            height:"50px"
            }}>{item.title}</Typography>
        <Link href="/electronics">
            <ImageListItem sx={{width:z(width)}} >
                <img
                    src={logo}
                    srcSet={`${item.img}?w=248&fit=crop&auto=format&dpr=2 2x`}
                    alt={item.title}
                    loading="lazy"
                    style={{
                      
                     
                    }}
                />
        </ImageListItem>
        </Link>
        </Box>

      ))}

      <Box sx={{
        position:"relative",
        height:"200px",
      }}>
      </Box>
      <Box sx={{
        position:"relative",
        height:"200px",
      }}>
      </Box>
      <Box sx={{
        position:"relative",
        height:"200px",
      }}>
      </Box>
      <Box sx={{
        position:"relative",
        height:"200px",
      }}>
      </Box>
    </ImageList>

    </div>
    );
        }
